import React from 'react';
import Button from '../../components/Button';

const tracks = [
  {
    name: 'Entry Free',
    color: '#15a13a',
    icon: '...',
    button: (
      <Button name='Entry Free' icon='...' color='#15a13a' />
    )
  },
  {
    name: 'Track #1',
    color: '#bf9713',
    icon: '...',
    button: (
      <Button name='Entry Free' icon='...' color='#15a13a' />
    )
  },
  {
    name: 'Track #2',
    color: '#bf8013',
    icon: '...',
    button: (
      <Button name={button.name} icon={button.icon} color={button.color} />
    )
  },
  {
    name: 'Track #3',
    color: '#bf6913',
    icon: '...',
    button: (
      <Button name={button.name} icon={button.icon} color={button.color} />
    )
  },
  {
    name: 'Track #4',
    color: '#bf3e13',
    icon: '...',
    button: (
      <Button name={button.name} icon={button.icon} color={button.color} />
    )
  }
];

export default tracks;
